export default function SearchBar(props) {
   return (
      <div>
          <input className={style.input} type='search'placeholder='Ingrese Id...'onChange={props.changeHandler} />
      <button className={style.boton} onClick={props.searchHandler}>Agregar</button>
      </div>
   )
}
